import './App.css'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import AuntificationPage from './components/Auntification/AuntificationPage'
import React from 'react'
import AuntifactionPageCallback from './components/Auntification/AuntifactionPageCallback'
import MainPage from './components/MainPage/MainPage'

/*
[Front] ----->{Discord API} -----> [Front] -----> [Back]
[Express js] --------------------> [Expressread {/aunth}] -> [Back]]

*/
// req.query.code
/*server.get('/auntification', (req, res) => {
	const code = req.query.code


	res.send('Авторизация успешна!')
})*/

function App() {
	return (
		<div>
			<AuntificationPage />

			<Routes>
				<Route path='/auntification' element={<AuntifactionPageCallback />} />
				<Route path='/menu' element={<MainPage />} />
			</Routes>
		</div>
	)
}

export default App
